import { FileEarmarkFill, FileEarmarkPdfFill, FileEarmarkText, FileEarmarkWordFill } from "react-bootstrap-icons";

const FileIcon =(props) =>{
    const formatFile = props.format.split('.')[1];
    let content;
    switch (formatFile) {
        case "pdf":
            content = <FileEarmarkPdfFill />
        case "docx":
            content = <FileEarmarkWordFill />
        case "txt":
            content = <FileEarmarkText />
        default:
            content = <FileEarmarkFill />
    }
